const [pokemons, set] = useState<Pokemon[]>(POKEMONS) ;

 return (
    <div>
        <h1>Pokedex </h1>
        <p>Il y'a {pokemons.length} pokemon dans le pokedox</p>
    </div>
 )
}
  
